import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <main className="content">
          <section className="profile">
            <div className="profile__profile-container">
              <img src="#" alt="Аватарка" className="profile__avatar" />
              <img className="profile__avatar-button" />
              <div className="profile__profile-info">
                <div className="profile__profile-info-container">
                  <h1 className="profile__title"></h1>
                  <button type="button" className="profile__edit-button" aria-label="редактировать профиль"></button>
                </div>
                <p className="profile__subtitle"></p>
              </div>
            </div>
            <button type="button" className="profile__add-button" aria-label="добавить элемент"></button>
          </section>
        </main>
    </div>
  );
}

export default App;
